    /**
     * 返回数字所有位数之和
     * @param $number
     * @return int
     */
    private function returnNumberSelfSum($number='') {
        $number = strval($number);
        $len = mb_strlen($number);
        if($len<1) return $number;
        $sum = 0;
        for($i = 0; $i < $len; $i++){
            $sum += $number[$i];
        }
        return $sum;
    }

    /**
     * 返回数字位数间最大差值
     * @param string $number
     * @return int|string
     */
    private function returnNumberSelfSpan($number='') {
        $number = strval($number);
        $len = mb_strlen($number);
        if($len<1) return $number;
        $nums = array();
        for($i = 0; $i < $len; $i++){
            $nums[] = $number[$i];
        }
        $span = (int)abs(max($nums) - min($nums));
        return $span;
    }
